svg.script:


var tl = gsap.timeline(
    {
        repeat: -1,
        repeatDelay: 1,
        onStart: function(){
            gsap.set("#lower_bar", {scaleX:0.3});
            gsap.set("#middle_bar", {scaleX:0.5});
            gsap.set("#upper_bar", {scaleX:0.1});
        }
    });

var t2 = gsap.timeline(
    {
        repeat: -1,
        repeatDelay: 1
    });

tl.add(
        gsap.fromTo(
                    "#upper_bar",
                            {
                                scaleX:0.3,
                                delay: 0,
                                duration:1,
                                transformOrigin:"left",

                            },
                            {
                                scaleX:1,
                                delay: 0,
                                duration: 1,
                                ease:Linear.easeInOut
                            }
                    )
        );

tl.add(
        gsap.fromTo(
                    "#middle_bar",
                            {
                                scaleX:0.3,
                                delay: 0,
                                duration:1,
                                transformOrigin:"left",

                            },
                            {
                                scaleX:1,
                                delay: 0,
                                duration: 1,
                                ease:Linear.easeInOut
                            }
                    )
        );

tl.add(
        gsap.fromTo(
                    "#lower_bar",
                            {
                                scaleX:0.1,
                                delay: 0,
                                duration:1,
                                transformOrigin:"left",

                            },
                            {
                                scaleX:1,
                                delay: 0,
                                duration: 1,
                                ease:Linear.easeInOut
                            }
                    )
        );

tl.add(
        gsap.fromTo(
                    "#lower_bar",
                            {
                                scaleX:1,
                                delay: 0,
                                duration:1,
                                transformOrigin:"left",

                            },
                            {
                                scaleX:0.1,
                                delay: 1,
                                duration: 1,
                                ease:Linear.easeInOut
                            }
                    )
        );

tl.add(
        gsap.fromTo(
                    "#middle_bar",
                            {
                                scaleX:1,
                                delay: 0,
                                duration:1,
                                transformOrigin:"left",

                            },
                            {
                                scaleX:0.3,
                                delay: 0,
                                duration: 1,
                                ease:Linear.easeInOut
                            }
                    )
        );

tl.add(
        gsap.fromTo(
                    "#upper_bar",
                            {
                                scaleX:1,
                                delay: 0,
                                duration:1,
                                transformOrigin:"left",

                            },
                            {
                                scaleX:0.5,
                                delay: 0,
                                duration: 1,
                                ease:Linear.easeInOut
                            }
                    )
        );

t2.add(
        gsap.to(
                    "#plus_symbol",
                            {
                                rotation:360,
                                delay: 0,
                                duration:4,
                                transformOrigin:"center center",
                                ease:Linear.easeNone    
                            }
                    )
        );
